import React from "react";
import "./LandingPage.css";
import { Container, Row, Col, Accordion } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.css";

function PhilippinesLandingPage() {
  return (
		<div>
			<section className="landing__page">
				<Row className="justify-content-md-center">
					<img className="landing__page__logo" src="assets/destinex-logo.png" alt="Destinex Logo" />
				</Row>
				<h2 className="landing__page__title_1">MBBS ADMISSION IN PHILIPPINES</h2>
			</section>
		</div>
	);
}

export default PhilippinesLandingPage;
